import React, { Component } from "react";
import { Link } from "react-router-dom";

export default class Userinfo extends Component {
  render() {
    const { imgUrl: avatar, firstName, lastName } = this.props;
    console.log(firstName, lastName);
    return (
      <aside>
        <Link>
          <img src={avatar} alt="" />
        </Link>

        <Link>
          <h2 className="names">{`${firstName} ${
            lastName ? lastName : ""
          }`}</h2>
        </Link>
      </aside>
    );
  }
}
